.hand[Three principles to be kind to yourself]

- Be nice to machines
- Be nice to humans
- Make sorting and searching easy


---

class: middle, inverse

.larger[.embolden[.plainwhite[Names machines like]]]
]


---

.hand[Don't leave white space]

- Machines sometimes get confused by spaces
- Easier to write code when files don't have spaces


--


- ‚úÖ `romeo-and-juliet_act01.docx`
- ‚úÖ `midsummer-nights-dream.docx`


- ‚ùå `romeo and juliet act 1.docx`
- ‚ùå `midsummer nights dream.docx`



---



.hand[Use letters, numbers, hyphens and underscores... that's it]

- Machines sometimes get confused by special characters
- Some characters have special meaning, e.g., `^.*?+|$`
- If you can, avoid accents `√±` (but consider accessibility!)


--


- ‚úÖ `what-the-cat.docx`
- ‚úÖ `essay_romeo-and-juliet_draft01.docx`


- ‚ùå `what-the-cat?.docx`
- ‚ùå `essay "romeo and juliet" draft01.docx`
- ‚ùå `essay "romeo and juliet" draft01(1).docx`




---

.hand[Don't assume case is meaningful]

- Some operating systems treat `a` and `A` the same
- Some operating systems treat `a` and `A` differently
- Never have two files that differ only in case
- Be consistent


--


- ‚úÖ `othello.docx`
- ‚úÖ `romeo-and-juliet.docx`


- ‚ùå `othello.docx`
- ‚ùå `Othello.docx`
- ‚ùå `Romeo-and-juliet.docx`




---

.hand[Use separator characters wisely]

- Use hyphen `-` to mean "different words that are part of the same chunk"
- Use underscore `_` to separate different chunks

--


- Chunk: [identifier] `reading01`, `reading02`, etc
- Chunk: [author] `shakespeare`, `plath`, etc
- Chunk: [title] `othello`, `the-bell-jar`, etc
- Chunk: [section] `act01`, `act02`, etc


--


- Order: [identifier] [author] [title] [section(optional)]
- ‚úÖ `reading01_shakespeare_romeo-and-juliet_act01.docx`
- ‚úÖ `reading01_shakespeare_romeo-and-juliet_act02.docx`
- ‚úÖ `reading02_shakespeare_othello.docx`
- ‚úÖ `reading19_plath_the-bell-jar.docx`

---


.hand[File names sometimes need to include dates&lt;br&gt;... but these dates don't sort in chronological order üò≠]

- `1-April-2012.R`
- `1-Jan-2009.R`
- `1-Jan-2012.R`
- `12-Jan-2012.R`
- `2-Jan-2012.R`
- `31-Dec-2009.R`

---

.hand[Happily, these dates do! üéâ]

- `2009-01-01.R`
- `2009-12-01.R`
- `2012-01-01.R`
- `2012-01-02.R`
- `2012-04-01.R`


--


.hand[Key principle with dates...]

- Dates should follow the `YYYY-MM-DD` format
- Known as the ISO 8601 standard


---

class: inverse

.hand[Place dates before slugs to preserve chronology...]




&lt;code class ='r hljs remark-code'&gt;&lt;span style='background-color:#ffff7f'&gt;"2009-01-01&lt;/span&gt;_original-analysis.R"&lt;br&gt;&lt;span style='background-color:#ffff7f'&gt;"2009-12-01&lt;/span&gt;_minor-changes-to-original.R"&lt;br&gt;&lt;span style='background-color:#ffff7f'&gt;"2012-01-01&lt;/span&gt;_analysis-at-2-year-follow-up.R"&lt;br&gt;&lt;span style='background-color:#ffff7f'&gt;"2012-01-02&lt;/span&gt;_minor-changes-to-follow-up.R"&lt;br&gt;&lt;span style='background-color:#ffff7f'&gt;"2012-04-01&lt;/span&gt;_combined-original-and-follow-up.R"&lt;/code&gt;

.hand[Use numbers as a prefix to order files]

- `01_preface.docx`
- `02_introduction.docx`
- `03_method.docx`
- etc...


- `19_appendix-09.docx`
- `20-appendix-10.docx`
- `21-appendix-11.docx`


--


- Left pad with `0` so that all numbers have same length
- Numbers are more robust than letters (alphabetical order varies)
